import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  console.log(process.env.BASEURL)
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit App.tsx and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
